import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for messages button to be visible and click it
    await page.waitForSelector('.messages-btn');
    await page.click('.messages-btn');

    // Wait for messages modal to appear
    await page.waitForSelector('#messagesModal', { state: 'visible' });

    // Take screenshot of the messages modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_messages_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_messages_modal.png'));

    // Verify that the messages modal opened
    const modalVisible = await page.isVisible('#messagesModal');

    return {
      success: modalVisible,
      action: modalVisible ? "Messages modal opened successfully" : "Failed to open messages modal",
      extractedData: {
        isModalVisible: modalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
